import React, { Component } from 'react'
import { getData } from '../../api/info'
const dataSource = [
    {
      key: '1',
      name: '胡彦斌',
      age: 32,
      address: '西湖区湖底公园1号',
    },
    {
      key: '2',
      name: '胡彦祖',
      age: 42,
      address: '西湖区湖底公园1号',
    },
  ];
  
  const columns = [
    {
      title: '品牌',
      dataIndex: 'brand',
      key: 'stock',
    },
    {
      title: '产品',
      dataIndex: 'proname',
      key: 'stock',
    },
    {
      title: '价格',
      dataIndex: 'price',
      key: 'stock',
    },
    {
        title:'图片',
        dataIndex:'proimg',
        key:'stock'
    },
    {
        title:'配置',
        dataIndex:'note',
        key:'stock'
    },
  ];
  

class AddList extends Component {
    componentDidMount() {
        getData(1, 2).then(res => {
            console.log(res)
        })
    }
    render() {
        return (
            <div>
                <Table dataSource={dataSource} columns={columns} />;
            </div>
        )
    }
}
export default AddList
